  !>     The Householder matrices \f$H_i\f$ are never stored, they are computed from its corresponding
  !>     Householder vectors \f$v_i\f$ and scalars \f$\text{ipiv}[i]\f$, as returned by \ref rocsolver_sgeqrf "GEQRF".
