  !> 
  !>     \f[
  !>         H_{j_i} = I - \text{ipiv}_j[i] \cdot v_{j_i} v_{j_i}'
  !>     \f]
  !> 
  !>     where the last m-i elements of the Householder vector \f$v_{j_i}\f$ are zero, and \f$v_{j_i}[i] = 1\f$.
