  !>               m >= n) or the (n-m)-th superdiagonal (when n > m) contain the
  !>               factor L_j; the elements above the subsuperdiagonal are the first i - 1
  !>               elements of Householder vector v_(j_i).
  !>     @param[in]
  !>     lda       rocblas_int. lda >= m.\n
