  !> 
  !>     \details
  !>     (This is the unblocked version of the algorithm).
  !> 
  !>     The problem solved by this function is either of the form
  !> 
  !>     \f[
  !>         \begin{array}{cl}
  !>         A X = \lambda B X & \: \text{1st form,}\\
  !>         A B X = \lambda X & \: \text{2nd form, or}\\
  !>         B A X = \lambda X & \: \text{3rd form,}
  !>         \end{array}
