      type(c_ptr),value :: handle
      integer(kind(rocblas_eform_ax)),value :: itype
      integer(kind(rocblas_evect_original)),value :: evect
      integer(kind(rocblas_fill_upper)),value :: uplo
      integer(c_int),value :: n
